import * as React from "react";
import * as ReactDOM from "react-dom/client";
import { createBrowserRouter, RouterProvider } from "react-router-dom";
import { Provider } from "react-redux";
import { configureStore, applyMiddleware } from "@reduxjs/toolkit";
import logger from 'redux-logger'; // Import Redux Logger middleware
import authReducer from "./redux/auth"; // Assuming you have your auth reducer in a file named auth.js
import "./index.css";
import Root, { loader as rootLoader, action as rootAction } from "./routes/root";
import ErrorPage from "./error-page";
import Profile from "./components/Profile";
import Userdashboard from "./components/UserDashboard";
import Admindashboard from "./components/AdminDashboard";
import UsersList from "./components/UsersList";
import ProtectedRoute from "./routes/ProtectedRoute";
const router = createBrowserRouter([
    {
        path: "/",
        element: <Root />,
        errorElement: <ErrorPage />,
        loader: rootLoader,
        action: rootAction,
        children: [
            {
                path: "profile",
                element:  <ProtectedRoute component={Profile} />,
                loader: rootLoader,
            },
            {
                path: "userdashboard",
                element:  <ProtectedRoute component={Userdashboard} />,
                loader: rootLoader,
            },
            {
                path: "userslist",
                element:  <ProtectedRoute component={UsersList} />,
                loader: rootLoader,
            },
            {
                path: "admindashboard",
                element:  <ProtectedRoute component={Admindashboard} />,
                loader: rootLoader,
            },
        ],
    },

]);


// Manually create middleware array
const middleware = [logger]; // Include Redux Logger middleware or any other middleware you want to use

// Create Redux store with middleware
const store = configureStore({
    reducer: {
        auth: authReducer,
    },
    middleware: getDefaultMiddleware => getDefaultMiddleware().concat(middleware),
});

ReactDOM.createRoot(document.getElementById("root")).render(
    <React.StrictMode>
        <Provider store={store}>
            <RouterProvider router={router} />
        </Provider>
    </React.StrictMode>


    // <>
